import Head from 'next/head';

const Meta = () => (
  <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <link ref="shortcut icon" href="/public/favicon.ico" />
    <link ref="stylesheet" type="text/css"
    href="../public/static/nprogress.css" />
    <title>Prospectable</title>
  </Head>
);

export default Meta;
